function minWindow(arr, k) {
    var n = arr.length;
    var curr_sum = 0;
    var max_sum = 0;

    for (var i = 0; i < n-k+1; i++) {
        curr_sum = 0;

        for (var j = 0; j < k; j++) {
            curr_sum = curr_sum + arr[i+j];
        }

        max_sum = Math.max(curr_sum, max_sum);
    }

    return max_sum;
}

function minWindowOrderOfN(arr, k) {
    var n = arr.length;
    var curr_sum = 0;
    var max_sum = 0;

    // first max sum
    for (var i = 0; i < k; i++) {
        curr_sum += arr[i];
    }

    max_sum = curr_sum;

    // looping through all other windows
    for (var j = k; j < n-k+1; j++) {
        curr_sum += arr[j] - arr[j-k];
        max_sum = Math.max(max_sum, curr_sum);
    }

    return max_sum;
}

